	public static void main(String str[]) {

		Properties properties = new Properties();

		try {
			@SuppressWarnings("unused")
			BufferedWriter out;
			properties
					.load(new FileInputStream(
							"C:\\p4\\FRANKLIN\\ZimbraQA\\SelNG\\framework\\locale\\ZmMsg.properties"));
			out = new BufferedWriter(new FileWriter("C:\\zsMsgs.properties"));
			Enumeration<Object> en = properties.keys();
			int i = 1;
			while (en.hasMoreElements()) {

				String key = (String) en.nextElement();
				String values = (String) properties.get(key);
				if (values.indexOf("\"{") >= 0) {
					values = values.replace("\"{", "{");
					values = values.replace("}\"", "}");
				}
				values = values.replace("\"", "");
				values = values.replace("\r", "");
				values = values.replace("\n", "");
				// if the keys have index, ignore them(java doesnt support
				// storing them as static variableNames
				if (!(key.indexOf("-") > 0) && !(key.indexOf("/") > 0)
						&& !(key.indexOf("@") > 0)) {
					String output = "public static final String " + key
							+ " = \"" + key + "::" + values + "\";";
					System.out.println(output);
				}
				// out.write(output);
				i++;
			}
		} catch (IOException e) {
			e.printStackTrace();
		}

	}

